oxy_webhelp_navlinks = {"agt_automate_task_using_agent_c-d4802e5029":{"topics":[{"title":"Creating agents","shortdesc":"<p class=\"shortdesc\">You can create a basic agent in an application to help you automate tasks.<\/p>","href":"agt_create_agent_t.html","attributes":{"data-id":"agt_create_agent_t"},"menu":{"hasChildren":false},"tocID":"agt_create_agent_t-d4802e5043","topics":[]},{"title":"Naming agents","shortdesc":"<p class=\"shortdesc\"> The names you give to manually-run agents appear as choices in the Actions menu. The names are case-sensitive and can be any combination of characters, including letters, numbers, spaces, and punctuation. Choose a name that reflects the purpose of the agent.<\/p>","href":"agt_rules_for_agent_names_r.html","attributes":{"data-id":"agt_rules_for_agent_names_r"},"menu":{"hasChildren":false},"tocID":"agt_rules_for_agent_names_r-d4802e5054","topics":[]},{"title":"Managing agents","shortdesc":"<p class=\"shortdesc\">You can edit and delete agents and move and copy agents within an application and from one application to another.<\/p>","href":"agt_manage_agent_t.html","attributes":{"data-id":"agt_manage_agent_t"},"menu":{"hasChildren":false},"tocID":"agt_manage_agent_t-d4802e5065","topics":[]},{"title":"Viewing a list of agents ","shortdesc":"<p class=\"shortdesc\">The agent list is a list of all of the agents in an application. Agents are programs that perform tasks.<\/p>","href":"agt_view_agent_list_t.html","attributes":{"data-id":"agt_view_agent_list_t"},"menu":{"hasChildren":false},"tocID":"agt_view_agent_list_t-d4802e5076","topics":[]}]}};